import React from 'react';
import laulibu from './assets/cover.png'; // attēls fonam

const LaulibuGredzeni = () => {
  return (
    <div>

      {/* HERO sadaļa */}
      <section
        className="h-[70vh] bg-cover bg-center flex items-center justify-center text-center"
        style={{ backgroundImage: `url(${laulibu})` }}
      >
        <h1 className="text-white text-3xl sm:text-4xl md:text-5xl font-medium px-4">
          Tavām domām un rokām darinātas rotas.
        </h1>
      </section>

      {/* Saturs */}
      <section className="max-w-5xl mx-auto px-6 py-16">
        <h2 className="text-3xl font-bold mb-6">Laulību gredzeni</h2>
        <p className="text-gray-700 text-lg leading-relaxed mb-4">
          Divu cilvēku savienība ir īpašs mirklis — savijas saknes, savijas dzīves. Tas jānosvin ar gredzeniem,
          kuros atklājas jūsu abu stāsts, kuros iekalta kopīga nākotne.
        </p>
        <p className="text-gray-700 text-lg leading-relaxed">
          Stāstiet savu ieceri mums, un mēs palīdzēsim to pārvērst gredzenos, kurus nest ar mīlestību un lepnumu.
        </p>
      </section>

    </div>
  );
};

export default LaulibuGredzeni;
